import React from "react";
import "./Table.css";
import Buttons from "./Buttons";

function Table(props) {
  const tableData = [
    ["", "Autumn1", "Autumn2", "Autumn3", "Autumn4", "Autumn5", "Autumn6"],
    ["EYFS", "", "", "", "", "", ""],
    ["KSY1", "", "", "", "", "", ""],
    ["KSY2", "", "", "", "", "", ""],
    ["KSY3", "", "", "", "", "", ""]
  ];

  const tableRows = tableData.map((rowData, index) => (
    <tr key={index}>
      {rowData.map((cellData, cellIndex) => (
        <td
          key={`${index}-${cellIndex}`}
          onDrop={props.onDrop}
          onDragOver={props.onDragOver}
        >
          <button title={cellData}/>
          {cellData}
        </td>
      ))}
    </tr>
  ));

  return (
    <div>
      <table>
        <thead>
          {tableRows[0]}
        </thead>
        <tbody>
          {tableRows.slice(1)}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
